const About = ({ team }) => {
  return (
    <div>
      {team.map((member) => {
        return <h3>{member.name}</h3>;
      })}
    </div>
  );
};

export default About;

// Get all the data at the build time
export const getStaticProps = async () => {
  return {
    props: {
      team: [
        { name: "Berk Özdoruk" },
        { name: "Oğuzhan Özkan" },
        { name: "Sinan Işık" },
      ],
    },
  };
};
